"function zy(a){var b,c,d,e,f;this.e=new Ay(this);this.f=a;b=(new Dy,Gy(),Cy);Ey(b);this.a=s0($doc);this.b=new gQb(this.a);this.c=new J2b(Hy(this.a).a);c=iQb(pv(this.c));fQb(this.b);c.b?a_(c.b,c.a,c.c):lQb(c.a);I2b(this.c,(d=new wR,uR(d,(new Hu,_u(),tu)),j$b((!d.d&&PQ(d,d.n),d.d),'Logowanie do systemu'),tR(d),Uv(d,this.e,(Y4(),Y4(),X4)),d),(eXb(),fQb(this.b)));this.d=new y$b;My(this.d,(e=new kH,jH(e,(f=new vCc,f.a+='<div style=\\'text-align: justify; padding-left : 70pt; padding-right : 70pt; font-family: Arial, Helvetica, sans-serif; font-size: 12pt;\\'> Arytmia serca to sytuacja, kiedy serce pracuje zbyt szybko, zbyt wolno lub zbyt niemiarowo w stosunu do prawid\\u0142owej pracy serca w rytmie zatokowym. Ju\\u017C w staro\\u017Cytnej Grecji odkryto cechy nieprawid\\u0142owego rytmu serca, kt\\xF3ry w skrajnej sytuacji mo\\u017Ce zaburza\\u0107 rytm codziennego \\u017Cycia. <p>Wsp\\xF3\\u0142cze\\u015Bnie rzadko wyst\\u0119puj\\u0105ce arytmie lub techniki ich leczenia definiuje si\\u0119 jako sytuacje kliniczne wyst\\u0119puj\\u0105ce sporadycznie, zwykle w liczbie poni\\u017Cej 1-2 przypadk\\xF3w na 5 tysi\\u0119cy os\\xF3b w populacji og\\xF3lnej. <\\/p> <p>Rzadka arytmiczna choroba mo\\u017Ce by\\u0107 zdiagnozowana jako pierwotnie genetycznie uwarunkowana arytmia (IPAS), arytmia leczona metod\\u0105 przezsk\\xF3rnej, cewnikowej ablacji (CA), stymulacj\\u0105 serca (PM), terapi\\u0105 resynchronizuj\\u0105c\\u0105 (CRT) lub implantowanym kardiowerterem-defibrylatorem (ICD). W Polsce, w ponad 35-milionowym kraju, gdzie wykonuje si\\u0119 do w przybli\\u017Ceniu 10 tysi\\u0119cy ablacji arytmii, do ponad 25 tysi\\u0119cy wszczepie\\u0144 rozrusznik\\xF3w serca, oraz kilku tysi\\u0119cy wszczepie\\u0144 ICD i CRT w\\u0142a\\u015Bciwie ka\\u017Cde zaburzenie rytmu i przewodzenia powinno uzna\\u0107 si\\u0119 za rzadk\\u0105 chorob\\u0119. <\\/p> <p>Ka\\u017Cda rzadkich arytmii to unikalny, problem jednego promila chorych spo\\u015Br\\xF3d kilku tysi\\u0119cy chorych prze\\u017Cywaj\\u0105cych nag\\u0142e zatrzymanie kr\\u0105\\u017Cenia (NZK), ponad stu tysi\\u0119cy chorych leczonych rocznie z powodu zawa\\u0142u serca (MI) lub kilkuset tysi\\u0119cy chorych z arytmi\\u0105 spo\\u015Br\\xF3d ponad 35 milion\\xF3w mieszka\\u0144c\\xF3w Polski. <\\/p> <p>Ten promil chorych, to jak promile znane z bezpiecze\\u0144stwa ruchu drogowego s\\u0105 istotne dla bezpiecze\\u0144stwa ca\\u0142ego spo\\u0142ecze\\u0144stwa i uczestnik\\xF3w ruchu drogowego. Wszyscy Ci chorzy zas\\u0142uguj\\u0105 i wymagaj\\u0105 indywidualnego wywiadu, badania, podej\\u015Bcia, oceny rokowania i terapii pacjenta i jego rodziny. Je\\u015Bli do\\u0142\\u0105czymy do tego wyj\\u0105tkowe sytuacje kliniczne (m\\u0142ody wiek, ci\\u0105\\u017C\\u0119, anomalie budowy serca i naczy\\u0144, r\\xF3\\u017Cnorodne techniki leczenia) to uzyskujemy niesko\\u0144czon\\u0105 list\\u0119 kombinacji rzadkich chor\\xF3b, ich objaw\\xF3w, rokowania i leczenia, kt\\xF3re s\\u0105 unikalnym zjawiskiem nie tylko w Polsce, ale by\\u0107 mo\\u017Ce i na \\u015Bwiecie. <\\/p> <p>Sporadycznie wyst\\u0119puj\\u0105ce choroby, poznanie ich mechanizm\\xF3w i sposob\\xF3w leczenia mo\\u017Ce sta\\u0107 si\\u0119 okazj\\u0105 do stworzenia nowatorskich metod diagnostyki, prewencji i leczenia wielu innych bardziej powszechnych chor\\xF3b, dotycz\\u0105cych ju\\u017C procent\\xF3w lub du\\u017Cej cz\\u0119\\u015Bci spo\\u0142ecze\\u0144stwa. <\\/p> <p>Z tych wzgl\\u0119d\\xF3w powsta\\u0142a inicjatywa RARE-A-CARE-skupiaj\\u0105ca lekarzy, pacjent\\xF3w i ich rodziny, pracownik\\xF3w s\\u0142u\\u017Cby zdrowia i nauk biologicznych, in\\u017Cynier\\xF3w i wynalazc\\xF3w, aby gromadzi\\u0107, przekazywa\\u0107 wiedz\\u0119, do\\u015Bwiadczenia i podsumowywa\\u0107 obserwacje kliniczne w sytuacjach rzadkich arytmii i rzadkich technik inwazyjnego leczenia arytmii serca. Opieka medyczna w rzadkiej arytmii (rare arrhythmic care = Rare -Arrhythmic \\u2013Care) to portal przeznaczony dla chorych i ich lekarzy, kt\\xF3rzy zajmuj\\u0105 si\\u0119 rzadkimi chorobami zwi\\u0105zanymi z zaburzeniami rytmu i przewodzenia. Celem portalu jest stworzenie platformy wymiany informacji, bazy wiedzy i elektronicznych konsultacji specjalist\\xF3w oraz rejestr\\xF3w medycznych rzadkich chor\\xF3b w celu ich lepszego poznania, diagnozowania, leczenia i zapobiegania powik\\u0142aniom. <\\/p> <p>Do projektu \"Rare-A-Care\" zostali zaproszeni polscy eksperci zaznajomieni z wyst\\u0119puj\\u0105cymi sporadycznie chorobami arytmicznymi. Czasami s\\u0105 ekspertami choroby jeszcze nie odkrytej w Polsce, czasami specjalistami leczenia jednego lub kilku chorych z wybitnie rzadk\\u0105 chorob\\u0105. Prowadzenie jednego chorego mo\\u017Ce jednak stanowi\\u0107 okazj\\u0119 do stania si\\u0119 ekspertem, do stania si\\u0119 nauczycielem dla innych lekarzy i inicjatorem odpowiedniego diagnozowania i leczenia innych chorych. Jeden przypadek choroby mo\\u017Ce otworzy\\u0107 okazj\\u0119 do lepszego leczenia dziesi\\u0105tek i setek innych chorych. Zwykle zapraszani do prowadzenia danego dzia\\u0142u lub rejestru eksperci stanowi\\u0105 grono pasjonat\\xF3w zainspirowanych doniesieniami z zagranicy, najnowsz\\u0105 wiedz\\u0105 i standardami leczenia oraz w\\u0142asnymi obserwacjami i do\\u015Bwiadczeniami. S\\u0105 oni te\\u017C ekspertami, kt\\xF3rzy sami sobie wyznaczyli najwy\\u017Csze kryteria jako\\u015Bci, dociekliwo\\u015Bci, w\\u0105tpliwo\\u015Bci i odpowiedzialno\\u015Bci przy mierzeniu si\\u0119 z rzadkimi chorobami arytmicznymi. Ich pacjentami staj\\u0105 si\\u0119 chorzy o czasami nieznanym rokowaniu, sposobie diagnostyki i leczenia, gdzie nie ma wytyczonych szlak\\xF3w post\\u0119powania i regu\\u0142. Razem z naszymi pacjentami, dla ich dobra i dla dobra innych chorych i lekarzy, chcemy poznawa\\u0107, rozumie\\u0107, pomaga\\u0107 wi\\u0119cej, lepiej i bardziej pewniej. Ka\\u017Cde do\\u015Bwiadczenia chorego i jego lekarza prowadz\\u0105cego rzadk\\u0105 chorob\\u0105 arytmiczn\\u0105 mo\\u017Ce stanowi\\u0107 okazj\\u0119 do odkrywania nowych form diagnostyki i terapii dla innych chorych i lekarzy. <\\/p> <p>Do grona ekspert\\xF3w zapraszamy te\\u017C ekspert\\xF3w z zagranicy \\u2013 lekarzy, organizacje pacjent\\xF3w i producent\\xF3w lek\\xF3w lub sprz\\u0119tu medycznego \\u2013 pozwalaj\\u0105cego na dob\\xF3r unikalnej wiedzy, konsultacji, wsparcia i odpowiedniej terapii. <\\/p> <p>RARE-A-CARE wychodzi na przeciw pacjentom i lekarzom, kt\\xF3rzy wcielaj\\u0105 w \\u017Cycie r\\xF3wnie\\u017C has\\u0142o: DARE-A-CARE czyli \\u201Crzadkiej arytmii opieka\\u201D - \"odwa\\u017C si\\u0119/o\\u015Bmiel si\\u0119 do arytmicznej opieki\" rzadkiej choroby. Rzadka choroba to wyzwanie dla lekarza i pacjenta - do podejmowania trudnych, czasami odwa\\u017Cnych decyzji, do o\\u015Bmielenia si\\u0119 do wprowadzania innowacyjnych technik diagnostyki i leczenia. Dlatego o\\u015Bmielamy si\\u0119 r\\xF3wnie\\u017C do zapraszania lekarzy i chorych do w\\u0142\\u0105czenia si\\u0119 w tworzenie tej platformy i wsparcie pacjent\\xF3w, lekarzy, naukowc\\xF3w i wynalazc\\xF3w w tworzeniu unikalnych, rzadkich metod diagnostycznych i leczniczych. <\\/p> <p>\"\\u015Acie\\u017Cka mo\\u017Ce nie istnie\\u0107. Twoje stopy by\\u0107 mo\\u017Ce po raz pierwszy wytycz\\u0105 szlak, dla drogi powrotnej, dla innych, dla poznania nieznanej krainy i losu. Wspomnienia z tej wyprawy mog\\u0105 by\\u0107 porad\\u0105 dla innych w\\u0119drowc\\xF3w, odkrywc\\xF3w i ludzi, kt\\xF3rych \\u017Cycie i los rzuci w t\\u0105 nieznan\\u0105 i nieodkryt\\u0105 krain\\u0119, kt\\xF3rym pomocn\\u0105 b\\u0119d\\u0105 chcieli poda\\u0107 podobni Tobie\". <\\/p> <\\/div>',new mOb(f.a)).a),e));wv(this.d,MOc)}\nfunction kv(){kv=oDb;Eu=new fOb((KOb(),new HOb('data:image/png;base64,')),64,64)}\n",
